const ProjectItem = ({project}) => {
	return(
		<tr>
			<td>
			{project.name}
		</td>
			<td>
			{project.url}
		</td>
			<td>
			{project.is_active}
		</td>

		</tr>
	)
}

const ProjectsList = ({projects}) => {
	return(
		<table>
			<tr>
			<td>
			name
		</td>

			<td>
			url
		</td>

			<td>
			is_active
		</td>
			</tr>
			{projects.map((project) => <ProjectItem project={project} />)}
		</table>
	)
}

export default ProjectsList;
